     console.log('entro aqui 02')
  }, []) //once


  const renderEventRow = (events) => {

    //const [columnevent, setColumnevent] = useState([]);
    const [groupevent, setGroupevent] = useState();
    
    if (events != null){
        console.log(events);
        
